import './hero.css'

function Hero(props) {

    return (      
        <header className="layout-header anim-start-header" id="layout-100vh">
            <figure>
                <img src={props.backimg} alt="web dev"/>
            </figure>
            <div>
                <h1>{ props.title }</h1>
                <p>{ props.description}</p>
            </div>
        </header>   
        );
   }
export default Hero
